    {url:'', text:'Khu vực thi Toàn quốc'},
    {url:'', text:'Khu vực thi Toàn quốc'}
]

const menu = arrray.map(x=>
    (
        <Menu>
            <Menu.Item>
            <a className="abc" target="_blank" rel="noopener noreferrer" href="http://www.alipay.com/">
                Khu vực thi Toàn quốc
        </a>
        </Menu.Item>
        </Menu>
    )
)

